import logo from "./logo-registro-civil-300-jpg.jpg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="background-header">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>

      <div className="background-grey1">

      </div>
      <div className="background-grey2">

      </div>
    </div>
  );
}

export default App;
